import ModificarFacturas from './Pages/ListarFacturas';
import iFactura from './Interfaces/Interfaces';
import { type } from 'os';
const arr: string[] =[
  'emma',
  'celes',
  'jime'
];

const App = () => {
  const [facturas, setFacturas] = useState<iFactura>();

  const newAddFactura = (factura:iFactura) => {
    setFacturas(...facturas, factura);
  }


  return (
    <Fragment>
      <ListarFacturas />
      <AltaFacturas />
      <ModificarFacturas />
    </Fragment>
  );
}

export default App;
